/* styles */
const stylesheet = {
	body: {
		backgroundColor: "black",
		height: '100%',
	},
	homemain: {
		display: 'flex',
		overflow: 'hidden',
		color: '#12263a',
		textAlign: 'center',
		justifyContent: 'center',
		position: 'relative',
		top: 500
	}

};

export default stylesheet;
